import webhelpui from '../Images/webhelpui-img.png';
import todolistImg from '../Images/my-todolist.png';
import keepnoteImg from '../Images/my-keepnote.png';
import cashregisterImg from '../Images/cash-register.png';
import stochProfitImg from '../Images/stock-profit.png';
import learnTrianglesImg from '../Images/learn-triangles.png';
import naviTranslatorImg from '../Images/navi-translator.png';

const ProjectData = [
    {
        Title: 'WebHelpUI',
        Image: webhelpui,
        Link: 'https://webhelp-ui.netlify.app/',
        Github: 'https://github.com/niketvns/webHelp-UI'
    },
    {
        Title: 'ToDoList',
        Image: todolistImg,
        Link: 'https://niketvns.github.io/ToDoList/',
    },
    {
        Title: 'Keep Note',
        Image: keepnoteImg,
        Link: 'https://niketvns.github.io/keep-note/',
    },
    {
        Title: 'Cash-register',
        Image: cashregisterImg,
        Link: 'https://nk-cash-register-manager.netlify.app/',
    },
    {
        Title: 'Stock-profit',
        Image: stochProfitImg,
        Link: 'https://nk-stock-profit-loss-calculator.netlify.app/',
    },
    {
        Title: 'Learn Triangles',
        Image: learnTrianglesImg,
        Link: 'https://learn-triangles-by-niket.netlify.app/',
    },
    {
        Title: 'Navi Translator',
        Image: naviTranslatorImg,
        Link: 'https://navi-translator-avatar.netlify.app/',
        Github: 'https://github.com/niketvns/navi-translator'
    }
]

export default ProjectData;
